\nHandje verse koriander (of peterselie)\nlimoen en sesamzaad om te serveren\nBereiding\n\nSnipper de ui en snijd de knoflook, rode peper en gember fijn. Snijd de kastanjechampignons in plakjes en verwijder de puntjes van de sugarsnaps.\n\nVerhit een soeppan met een eetlepel olie en fruit hierin de ui, knoflook, peper en gember aan. Voeg vervolgens de kastanjechampignons en kipstuckjes toe en bak nog even mee. Doe de rode curry pasta in de pan en bak dit circa 1 minuut mee met de rest. Voeg daarna de kokosmelk en groentebouillon toe en laat zachtjes koken. Doe op het laatste de sugarsnaps erbij en laat dit nog circa 4 minuten meekoken.\n\nKook ondertussen in een andere pan de ramen noedels klaar volgens de verpakking. Giet ze af en spoel af onder koud water.\n\nVerdeel de vegan kippensoep over 4 borden en verdeel vervolgens ook de noedels hierover. Maak de soep af met verse koriander, limoen en sesamzaad.','Vegan kippensoep',46),(7,'2021-01-27 20:54:59.962521','2021-01-27 20:54:59.962538',0,'Een vegetarische variant op de Japanse ramen, gevuld met noedels, paddenstoelen, paksoi en een gekookt ei',3,'Japanse-ramen.jpg',_binary 'xœ”yUPL\Ô,\î\Ü!¸³¸[pwYœ\0‹\Ã\â²Hwww‡\Å\İ}q\rÁ=	\Z r¿ÿ¯º\÷\ñ\öT\Í\Ãt\ÍÔ™\éSgjşmş;@ÀWSRUB@DD@@ü¯!ü\ÛAG@AşHÿÓ£   ¢a¡¡¡¢¢\á``¢c\á\á¼\Ã\Ã\ÃÁ\Å}G@J\ôŸ„\0—ˆ’ˆ„Œœ‚‚\â!\r9\r)9ùÿ,‚ø\ßT4T4l44lr|\\|\òÿoüA À@\Ì@şˆŒÈ€€D€ˆL€øoú¿8Qÿ\'\ÜÿTD$d4tŒÿX*D$\äÿ‡Eø\rı\ß6\ò,>2şcUşrZ§\Õb\ÆC\äÅ·Šhµ\íbA\Ñ\ÓS\ÔO¢Z.¹X\Õ?«¼\ç\ä3j\'j9HLŠ”\Ç;8úsÊ·½R\nš-~Ğ½t\"/y¼JY\Z\Ân\ï\Û69fC·Zx\r©£NM°»Z3iËƒ\Ûc—#21b§™\â¸]¬\ÓjN\ËP\Ã¤Zı–Z\æS1\ÓC\Ûá†\Ø1s|¶©+\îş¸µù8.G\òË¶¶‡©‚b\óAzı”“]\Éú¡\ç\È,6\È\Û}\ÇûB\Ğ5/\nAw<G•†S°yÿ\Ğeq£3\ò21\õş‘b\Ó\í\ÛbL4\õ\à²\ëû‡ \ë\÷\åQ\Ã.ÁgoR\è8\ÛVUşp™IX…\ô\Ì\Æ\ğŒ\äUÌ˜7”`€wk\ËtNk$„.–O(.&kJ\æ/MĞ¼œD\î\í\Î\ïŸ2¡Ï—\È\ÊN0*«±TÀr\Û&\ÈI<ÿÅ”¨„tŸ=1M5\ò\éÖ©\Év´û7&e­˜Ø¨§|şd´·\r£9A\ÚJÌ—[—P‰d1\İPùn#7\Ø\ğ­Kru¢-ºù¼·/‹•3\ó;0i~kk\òœ\Ïú&\Ô\óÊ‰\ô!{}aP92pŠ\ì\ò.\"Ih\åøÀ\Ò\0­UesÍˆ\é1A™a\â‡w\Î0ÿÄ„E.\ÜûºÁ§;§l\æq{\Z\